room.onPlayerTeamChange = (changedPlayer, byPlayer) => {
	teams();
	if (red.length <= players && blue.length <= players) { // Se o n√∫mero de jogadores do time azul e vermelho for menor que {players}, o jogo come√ßa.
		setTimeout(()=>{
			room.startGame();
		},3000);
	}
	if (red.length == players && blue.length == players) { // Se o n√∫mero de jogadores no time azul e vermelho for igual a {players}, o jogo reinicia.
		room.stopGame();
		room.startGame();
	}
}
